  const[mode , SetMode]=useState('dark')

  const togglemode = ()=>{
    if(mode==='light')
    {
      SetMode='dark'
    }
    else
    {
      SetMode='light'
    }

  }
  return (
    <>

<Navbar title="Testutlis" text="About" mode={mode} togglemode={togglemode} />
<div className="container my-3">
<Textform heading="Enter Your Text"/>

</div>

    </>

  );
}

export default App;
